import React from "react";

const Tweet = ({ tweetContent }) => {
  const {
    created_at,
    text,
    user,
    retweet_count,
    favorite_count,
    media,
  } = tweetContent;

  return (
    <blockquote className="twitter-tweet blockquote">
      <span className="author">{user.display_name}</span>
      <span className="time">{created_at}</span>
      <p lang="en" dir="ltr">
        <span>{text}</span>
        {/* <a href="#"></a>
      <video poster="url" controls>
        <source src="url" type="url" />
      </video>
      <a href="url">
        <img className="img-thumbnail" src="" />
      </a> */}
      </p>
      <footer>
        <h6>
          <i className="fa fa-comment-o"></i> 20 &nbsp;
          <i className="fa fa-retweet"></i> {retweet_count} &nbsp;
          <i className="fa fa-heart-o"></i> {favorite_count} &nbsp;
        </h6>
      </footer>
    </blockquote>
  );
};

export default Tweet;
